import React from "react"
import "./Contents.css"
import Main from "../pages/Main"
import { Switch, Route, Redirect, withRouter } from "react-router-dom";

function Contents() {
  return (
    <div className="Contents">
      <Switch>
        <Route
            path='/main'
            render={() => (
              <Main />
            )}
        />
      </Switch>
    </div>
  )
}

export default Contents
